int main()
{
    ios::sync_with_stdio(false);
    cin.tie(nullptr);
    int tests;
    cin >> tests;
    while (tests--) {
        int n, k;
        cin >> n >> k;
        vector<int> diff(1 + n);
        const int INF = 1000000000;
        for (int i{1}; i <= n; ++i) {
            int a;
            cin >> a;
            cerr << a << ' ';
            if (a <= i) {
                diff[i] = i - a;
            } else {
                diff[i] = INF;
            }
        }
        cerr << endl;
        vector<vector<int>> moves(1 + n, vector<int>(1 + n, INF));
        moves[0][0] = 0;
        for (int i{1}; i <= n; ++i) {
            cerr << "Element " << i << endl;
            for (int j{0}; j <= i; ++j) {
                moves[i][j] = moves[i - 1][j];
            }
            cerr << "Index before " << i << " - " << diff[i] << " = " << i - diff[i] << endl;
            if (i - diff[i] < 0) {
                cerr << "Skipping" << endl;
                continue;
            }
            for (int j{1}; j <= i; ++j) {
                cerr << i << ',' << j << " = min(" << moves[i][j] << ", " << moves[i - diff[i]][j - 1] + 1 << ")" << endl;
                moves[i][j] = min(moves[i][j], moves[i - diff[i]][j - 1] + 1);
            }
        }
        cerr << "ANS = " << *min_element(moves[n].begin() + k, moves[n].end()) << endl;
    }
    return 0;
}

