public class Main {

    void aa(int[] nums) {
        bb(nums, 0);
        for (int i = nums.length - 1; i >= 0; --i) {
            int tmp = nums[i];
            nums[i] = nums[0];
            nums[0] = tmp;
            ee(nums, i,0);
        }
    }

    void bb(int[] nums, int rt) {
        if (rt >= nums.length) {
            return;
        }
        bb(nums, cc(rt));
        bb(nums, dd(rt));
        ee(nums, nums.length, rt);
    }

    int cc(int idx) {
        return idx * 2 + 1;
    }

    int dd(int idx) {
        return idx * 2 + 2;
    }

    void ee(int[] nums, int n, int idx) {
        while (cc(idx) < n) {
            int l = cc(idx);
            int r = dd(idx);
            if (r < n && nums[l] < nums[r]) {
                l = r;
            }
            if (nums[idx] < nums[l]) {
                int tmp = nums[idx];
                nums[idx] = nums[l];
                nums[l] = tmp;
                idx = l;
            } else {
                return;
            }
        }
    }
}

import java.util.Random;

public class Main {

    public static void main(String[] args) {
        Random random = new Random();
        int n = Math.abs(random.nextInt()) % 20 + 1;
        int[] nums = new int[n];
        for (int i = 0; i < n; ++i) {
            nums[i] = Math.abs(random.nextInt()) % 100;
            System.out.printf("%d ", nums[i]);
        }
        System.out.println();
        sort(nums);
        for (int x: nums) {
            System.out.printf("%d ", x);
        }
        System.out.println();
    }

    static void sort(int[] nums) {
        build(nums, 0);
        for (int i = nums.length - 1; i >= 0; --i) {
            int tmp = nums[i];
            nums[i] = nums[0];
            nums[0] = tmp;
            pushDown(nums, i,0);
        }
    }

    static void build(int[] nums, int rt) {
        if (rt >= nums.length) {
            return;
        }
        build(nums, getL(rt));
        build(nums, getR(rt));
        pushDown(nums, nums.length, rt);
    }

    static int getL(int idx) {
        return idx * 2 + 1;
    }

    static int getR(int idx) {
        return idx * 2 + 2;
    }

    static void pushDown(int[] nums, int n, int idx) {
        while (getL(idx) < n) {
            int l = getL(idx);
            int r = getR(idx);
            if (r < n && nums[l] < nums[r]) {
                l = r;
            }
            if (nums[idx] < nums[l]) {
                int tmp = nums[idx];
                nums[idx] = nums[l];
                nums[l] = tmp;
                idx = l;
            } else {
                return;
            }
        }
    }
}

